EFFSHORTINDEX search_object(unsigned int o) FASTCALL
{
    EFFSHORTINDEX idx;
    for(idx=0; idx<OSIZE;++idx)
        if(obj[idx].code==o)
            return idx;
    return 0;
}

object *search_object_p(unsigned int o) FASTCALL
{
    return &obj[search_object(o)];
}
EFFSHORTINDEX search_room(EFFSHORTINDEX r) FASTCALL
{
    EFFSHORTINDEX idxl;
    for(idxl=0; idxl<RSIZE;++idxl)
        if(world[idxl].code==r)
            return idxl;
    return 0;
}

void restart(void)
{
    EFFSHORTINDEX i;
    EFFSHORTINDEX j;
    for(i=1;i<129;++i){
        marker[i]=0;
        counter[i]=0;
    }
    for(j=0; j<RSIZE;++j)
        for(i=0; i<NDIR;++i)
            world[j].directions[i]=original_connections[j][i];
    marker[124]=true;
    marker[121]=true;
    marker[125]=0;
    next_position=100;
    for(j=0; j<OSIZE;++j)
        obj[j].position=original_position[j];
}

void show_messagenlf(char *m) FASTCALL
{
    boolean o;
    cpointer=0;
    bpointer=0;
    compressed=m;
    do{
        o=decode();
        writesameln(decompress_b);
    } while(o);
}

void show_message(char *m) FASTCALL
{
    show_messagenlf(m);
    printnewline();
}

boolean are_you_sure(void)
{
    show_message(areyousure);
    GETS(playerInput,BUFFERSIZE);
    if(playerInput[0]=='Y' || playerInput[0]=='y') {
        return 1;
    }
    return 0;
}

#define inventory()\
{\
    boolean gs=false;\
    EFFSHORTINDEX i;\
    show_message(message1032);\
    for(i = 0; i<OSIZE; ++i) {\
        dummy=obj[i].position;\
        if(dummy==CARRIED||dummy==WEARED) {\
            gs=true;\
            evidence2();\
            show_messagenlf(obj[i].desc);\
            normaltxt();\
            if(dummy==WEARED){\
                printspace();\
                show_messagenlf(message1018);\
            }\
            printnewline();\
        }\
    }\
    if(gs==false) show_message(message1033);\
}

void move(unsigned char dir) FASTCALL
{
    EFFSHORTINDEX p;
    p=world[search_room(current_position)].directions[dir];
    if(p) {
        next_position=p;
        marker[120]=false;
        return;
    } else 
        show_message(message1008);

}

boolean get(unsigned int o) FASTCALL\
{
    odummy=search_object_p(o);
    if(odummy->position!=current_position) {
        show_message(message1006);
    } else if((odummy->attributes&ISNOTMOVABLE)==0) {
        show_message(message1005);
    } else {
        odummy->position=CARRIED;
        return false;
    }
    return true;
}
